import logo from './logo.svg';
import app from "./firebase";
import { getFirestore, collection, getDocs, setDoc, doc } from 'firebase/firestore/lite';
import './App.css';
import GoogleLogin from 'react-google-login';
// let clientId = "1098019005957-m2sjfa61abn8dsb8tk0eplog0dbsqi5d.apps.googleusercontent.com";
let clientId = "1098019005957-m2sjfa61abn8dsb8tk0eplog0dbsqi5d.apps.googleusercontent.com";
const db = getFirestore(app);

function App() {

	const responseGoogle = (a) =>{

		console.log("Hello1", a)

		// return cityList;
	}

	const AddUsers = async () =>{
		await setDoc(doc(db, "users", "LA"), {
			name: "Los Angeles",
			state: "CA",
			country: "USA"
		});
		console.log("Added user")
	}

	const responseGoogle1 = async (a) =>{
		const citiesCol = collection(db, 'users');
		const citySnapshot = await getDocs(citiesCol);
		const cityList = citySnapshot.docs.map(doc => doc.data());
		console.log("Hello", a, cityList);
	}

	return (
		<div className="App">
			<header className="App-header">
				<img src={logo} className="App-logo" alt="logo" />
				<p>
					Edit <code>src/App.js</code> and save to reload.
				</p>
				<a
					className="App-link"
					href="https://reactjs.org"
					target="_blank"
					rel="noopener noreferrer"
				>
					Learn React
				</a>
				<GoogleLogin
					clientId={clientId}
					buttonText="Login"
					onSuccess={responseGoogle}
					onFailure={AddUsers}
					cookiePolicy={'single_host_origin'}
				/>
			</header>
		</div>
	);
}

export default App;
